import React from 'react';
import * as S from './styles';
export default function Projects() {
  return (
    <>
      <S.Body>
        <S.TextTitle>Projetos | Meu portfólio</S.TextTitle>
        <div>
          <a href="https://vimeo.com/manage/videos/739124026">
            <iframe
              src="https://vimeo.com/manage/videos/739124026"
              frameborder="0"
            ></iframe>
          </a>
        </div>
      </S.Body>
    </>
  );
}
